import React from "react";
import CategoryNEW from "./category-new-component";
import { useNavigate } from "react-router-dom";
const Products = () => {
  const navigate = useNavigate();
  return (
    <div>
      <div className="page-bar">
        <ul className="pages">
          <li
            onClick={() => {
              navigate("/Products");
            }}
          >
            ViewALL /{" "}
          </li>
        </ul>
      </div>
      <CategoryNEW />
    </div>
  );
};

export default Products;
